import React from "react";
import { Tr, Td,Button} from '@chakra-ui/react'

const Itemshop = ({data})=>{ 
    return(
    <>
      <Tr>
        <Td>{data.nombre}</Td>
        <Td>
          <Button colorScheme='blackAlpha'  borderRadius={'10px'} size="xs">+</Button>
          {data.cant} 
          <Button colorScheme='blackAlpha' size="xs">-</Button>
        </Td>
        <Td isNumeric>$ {data.precio}</Td>
      </Tr>
    </>    
    )
}

export default Itemshop
